import React from 'react';
import styled from 'styled-components';

//
import image1 from '../images/insta-one.JPG';
import image2 from '../images/insta-two.JPG';

const Instagram = () => {

    const Container = styled.div`
        display: grid;
        grid-gap: 10px;
        grid-template-columns: 100px 100px 100px;
        background-color: #fff;
        color: #444;
    `
    const ItemOne = styled.div`
        grid-column-start: 1;
        grid-column-end: 6;
        grid-row-start: 1;
        grid-row-end: 4;

    `
    const ItemTwo = styled.div`
        grid-column-start: 6;
        grid-column-end: 12;
        grid-row-start: 1;
        grid-row-end: 4;

    `
    const ItemThree = styled.div`
        grid-column-start: 1;
        grid-column-end: 4;
        grid-row-start: 4;
        grid-row-end: 14;
    `
    const ItemFour = styled.div`
        grid-column-start: 4;
        grid-column-end: 12;
        grid-row-start: 4;
        grid-row-end: 14;
    `

    return (
        <div class="wrapper">
            <div class="box a"><img src={image1} style={{height: '100%', width: '100%', objectFit: 'cover'}}/></div>
            <div class="box b"><img src={image1} style={{height: '100%', width: '100%', objectFit: 'cover'}}/></div>
            <div class="box c"><img src={image1} style={{height: '100%', width: '100%', objectFit: 'cover'}}/></div>
            <div class="box d"><img src={image1} style={{height: '100%', width: '100%', objectFit: 'cover'}}/></div>

        </div>
    )
}

export default Instagram;
